import React from "react";
import css from "./SelectFilter.module.css";

const SelectFilter = ({ canvasRef, frameRef }) => {
  return <div className={css.container}>
    <div className={css.leftSide}></div>
    <div></div>
  </div>;
};

export default SelectFilter;
